  input: 'TEXT,"F3A","","Dear Ms. Balderama, I am writing in response to your Request
    for Additional Information Letter datedd May 13, 2003. With regard toyour first
    two inquiries relating to the cycle to date totals, I have advised you that the
    reason that the cycle to date totals do not equal the sum of column B figures
    on the previous report is that the mid year report stated year to date totals.
    The committee was informed via a Request for Additional Information letter dated
    October 16, 2001 that the committee should report a cycle to date rather that
    a calendar to date beginning with the next report. With regard to your inquiry
    relating to additional contributions that should be itemized, please note the
    record of the following contributors, to wit: Association of Trial Lawyers of
    America, Inc.; 3/21/01- $1,000.00, 6/30/01-$1,500.00; 10/31/01-$2,500.00; 12/21/01-$5,000.00.
    House Pac; 3/19/01-$1,000.00; 5/1/01-$1,000.00; 6/7/01-$1,500.00; 12/5/01-$500.00;
    12/5/01-$1,000.00; 12/19/01-$5,000.00. Verizon Communications, Inc. Good Government
    Club, 11/7/00-$1,000.00; 3/13/01-$1,000.00; 5/31/01- $1,000.00; 12/19/01-$500.00;
    3/19/01-$1,000.00; 10/16/02-$1,000.00. With regard to your inquiry relating to
    our committee''s disclosure of the identification of all individuals who contribute
    in excess of $200 in an election cycle, please note the following: All invitations
    or solicitations that our committee sends contain a clear and conspicuous request
    for contributor information as required by Federal Law. Depending on the event,
    either a response card or a cut off is provided asking for the name, address,
    occupation and employer of the contributor. Additionally, at all events, a volunteer
    who collects contrbutions has what we refer to as compliance sheets. These sheets
    are filled out by those contributors who did not fill out the response card or
    for those who pay at the door.  Second, once all the contributions are entered
    into our database, is determined whether or not the information is complete. If
    it is, our datatbase is set up to generate a thank you letter. If the information
    is not complete, the program will generate a request for information letter. This
    request for information letter has a self addressed stamped envelope to be returned.
    Once the information is returned it is placed in the appropriate folder to be
    updated in our datatbase so that an amendment can be generated. Also, be advised
    that I have reviewed the report and have added information to political committees
    pursuant to your request. Additionally, I am filing an amendment simultaneous
    with this report. In relation to you inquiry regarding in-kind contributions,
    I have made the necessary adjustments that will be reflected on the amendment.
    I trust this response satisfies your inquiry, however, feel free to contact me
